// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.27;

import {HyperAccountCommitMinter} from "./HyperAccountCommitMinter.sol";

contract HyperAccount9CharCommitMinter is HyperAccountCommitMinter {
    constructor(address _hypermap, uint256 _minCommitAge, uint256 _maxCommitAge)
        HyperAccountCommitMinter(_hypermap, _minCommitAge, _maxCommitAge)
    {}

    function initialize() public override initializer {
        __UUPSUpgradeable_init();
        __EIP712_init("HyperAccount9CharCommitMinter", "1");
    }

    function _mint(address to, bytes calldata name, bytes calldata initialization, address implementation)
        internal
        override
        returns (address tba)
    {
        if (name.length < 9) revert("Label too short");
        return super._mint(to, name, initialization, implementation);
    }
}
